/*
 *  for문을 사용해서 1부터 100까지 수중 출력하세요 (단 한줄에 10개씩 출력한다.)
 */

public class 문제4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1; i<=100;i++)
		{
		  for(int j=1; j<=10; j++)
		  {
			System.out.print(i+" ");
		  }
		    System.out.println();
		}
			
	}

}
